import React from "react";
import {Image, Popup, Button} from 'semantic-ui-react';

function element(){

    return(
        <div id="element">
            <Popup
                trigger={<Button>Click me</Button>}
                content='Hide the popup on any scroll event'
                on='click'
                hideOnScroll
            />
           <Image  src='../img/tayara.png' size="tiny">
           </Image>
        </div>
    )
}


export default element;
